def cumboost(annual,dual,name,name2):
    sarscov2probnoreinfectiontimecourse = [1]
    day = 1
    
    # First calculation outside the loop
    sarscov2probnoreinfectiontimecourse.append(
        sarscov2probnoreinfectiontimecourse[day - 1] * 
        (annual[day])
    )
    currday=1
    # Main loop
    for day in range(1,1825):
        day += 1
        currday+=1
        if day % 365 == 0:
            currday=1
        new_value = (sarscov2probnoreinfectiontimecourse[day - 1] *
                    (annual[currday]))
    
        
        sarscov2probnoreinfectiontimecourse.append(new_value)
        
    
    sarscov2probnoreinfectiontimecourse2 = [1]
    day = 1
    
    # First calculation outside the loop
    sarscov2probnoreinfectiontimecourse2.append(
        sarscov2probnoreinfectiontimecourse2[day - 1] * 
        (dual[day])
    )
    currday=1
    # Main loop
    for day in range(1,1825):
        day += 1
        currday+=1
        if day % 365 == 0:
            currday=1
        new_value = (sarscov2probnoreinfectiontimecourse2[day - 1] *
                    (dual[currday]))
    
        
        sarscov2probnoreinfectiontimecourse2.append(new_value)

    sarscov2probnoreinfectiontimecourse=1-np.array(sarscov2probnoreinfectiontimecourse)
    sarscov2probnoreinfectiontimecourse2 = 1-np.array(sarscov2probnoreinfectiontimecourse2)
    plt.figure(figsize=(10, 6))
    hfont = {'fontname':'Calibri'}
    plt.xlabel('Years post first booster', **hfont,fontweight='bold',fontsize=13, color='#4f4f4f')
    plt.ylabel('Cumulative probability of breakthrough infection', **hfont,fontweight='bold',fontsize=13, color='#4f4f4f')
    plt.xticks(**hfont,fontsize=13)
    plt.yticks(**hfont,fontsize=13)
    plt.plot(sarscov2probnoreinfectiontimecourse, color='#336666')
    plt.plot(sarscov2probnoreinfectiontimecourse2, color = '#999933')
    plt.title(name2,**hfont,fontsize=15,fontweight='bold', color='#4f4f4f')
    plt.savefig('/Users/hayley/Documents/townsend/spring_25/elder_boostertime/figs/'+name+'.pdf')
    plt.show()

